The Engine needs to know that there shall be a new asset type. That is why we need to register a new Truth type. Those steps are the same for every truth type, be it an asset or not. We need to define a globally accessible definition for the name of the type and its hash value. The usual place for this is a header file. Example Header file: my_asset.h #pragma once
#include "entity_api_types.h"
//... more code
#define TM_TT_TYPE__MY_ASSET "tm_my_asset"
#define TM_TT_TYPE_HASH__MY_ASSET TM_STATIC_HASH("tm_my_asset", 0xc0995d6c144ac64aULL) (Do not forget to run hash.exe when you create a TM_STATIC_HASH, mode information here.) Now we need to define the layout of our asset type. We should always do this during plugin load. (tm_load_plugin) During this call we need to register a function to the TM_THE_TRUTH_CREATE_TYPES_INTERFACE_NAME interface. This function is typically called create_truth_types, but its name can be arbitrary. Note: An interface is an abstract structure that maps a struct (the interface) to a hash value/name. It allows for customization points. In The Machinery, the Engine uses this extensively. Example tm_load_plugin function for my_asset.c TM_DLL_EXPORT void tm_load_plugin(struct tm_api_registry_api *reg, bool load)
{
tm_add_or_remove_implementation(reg, load, TM_THE_TRUTH_CREATE_TYPES_INTERFACE_NAME, create_truth_types);
} After we did this, let us implement the actual function. First, we need to create a Truth type: We use the function tm_the_truth_api->create_object_type(tm_the_truth_o *tt, const char *name, const tm_the_truth_property_definition_t *properties, uint32_t num_properties); . This one will register in the Truth a new type with the name and the properties we give the type. At this point, we have a normal The Truth type. But we wanted to create an asset! What is the difference between Truth Type and Asset? An asset is just a normal truth type. The structure of an asset in the truth is defined in the foundation/the_truth_assets.h. An asset itself is, therefore, nothing else than a wrapper around our actual asset. It provides a generic interface to provide some standard information. The structure of an asset type looks like this: enum { // Name of the asset. TM_TT_PROP__ASSET__NAME, // string // Directory where the asset resides. For top-level assets, this is `NULL`. TM_TT_PROP__ASSET__DIRECTORY, // reference [[TM_TT_TYPE__ASSET_DIRECTORY]] // Labels applied to this asset. TM_TT_PROP__ASSET__UUID_LABELS, // subobject_set(UINT64_T) storing the UUID of the associated label. // Subobject with the actual data of the asset. The type of this subobject depends on the type // of data storedin this asset. TM_TT_PROP__ASSET__OBJECT, // subobject(*) // Thumbnail image associated with asset TM_TT_PROP__ASSET__THUMBNAIL, // buffer
}; The truth type of the text file we just created will live as a subobject of the Asset Truth Type in the property field: TM_TT_PROP__ASSET__OBJECT. Let us move on and go back and finish the definition of our type. Let us add a file extension to our type. All we need to do is add an aspect of type TM_TT_ASPECT__FILE_EXTENSION to our Truth Type. You can find it in the following header file foundation/the_truth_assets.h. Note: The Machinery will automatically prefix your file extension with tm_ In code, this looks as follows: static void create_truth_types(struct tm_the_truth_o *tt)
{ const tm_tt_type_t type = tm_the_truth_api->create_object_type(tt, TM_TT_TYPE__MY_ASSET, 0, 0); tm_the_truth_api->set_aspect(tt, type, TM_TT_ASPECT__FILE_EXTENSION, "my_asset");
} We create a type of name TM_TT_TYPE__MY_ASSET with no properties and a file extension my_asset (.tm_my_asset in your explorer).

