Sometimes it is necessary to create an asset via code. The Asset Browser plugin provides a solution for this the tm_asset_browser_add_asset_api. With this API assets can be created and added to the current project. To add an asset to the asset browser a few steps are needed. First, we need to pick the correct type. We need to request it from the truth via the type hash (in this example, TM_TT_TYPE_HASH__MY_ASSET). Secondly, we should create an object of the correct type. Then we can request the asset browser API if the API not globally accessible. If we already requested the API, we do not need to do this step and can use the already defined instance of the API. We need to create a undo scope. (We could also use TM_TT_NO_UNDO_SCOPE) but its not recommended! Then, we should decide if we should highlight the new asset in the Asset Browser. (should_select=true) If that's needed, an instance of the current UI is required. Then, the magic can happen and we can call the function add of the tm_asset_browser_add_asset_api The following code example will demonstrate how to add my_asset via code to the current project. // ... other includes
#include <foundation/the_truth.h>
#include <foundation/undo.h> #include <plugins/editor_views/asset_browser.h> #include "my_asset.h"
//... other code static void add_my_asset_to_project(tm_the_truth_o *tt,struct tm_ui_o *ui,const char*asset_name, tm_tt_id_t target_dir){ const tm_tt_type_t my_asset_type_id= tm_the_truth_api->object_type_from_name_hash(tt, TM_TT_TYPE_HASH__MY_ASSET); const tm_tt_id_t asset_id = tm_the_truth_api->create_object_of_type(tt, my_asset_type_id, TM_TT_NO_UNDO_SCOPE);
tm_asset_browser_add_asset_api *add_asset = tm_global_api_registry->get(TM_ASSET_BROWSER_ADD_ASSET_API_NAME);
const tm_tt_undo_scope_t undo_scope = tm_the_truth_api->create_undo_scope(tt, TM_LOCALIZE("Add My Asset to Project"));
bool should_select = true;
// we do not have any asset label therefore we do not need to pass them thats why the last
// 2 arguments are 0 and 0!
add_asset->add(add_asset->inst, target_dir, asset_id, asset_name, undo_scope,should_select,ui,0,0);
}

